@Listeners(com.qpros.common.LogManger.class)
public class TS_1_ExploreHomePage extends Base {
    LogManger logManger= new LogManger(getClass().getName());

    @BeforeClass
    public void setUpBrowser() {
        String OsType = OsValidator.getDeviceOs();
        DriverType browser = getBrowser();
        initiateDriver(OsType, browser);
        driver.navigate().to(ReadWriteHelper.ReadData("BaseURL"));
    }


    @Test(description = "The User Explore Consumer Home Page",suiteName = "Explore_HomePage", priority = 1,
            retryAnalyzer = com.qpros.helpers.RetryAnalyzer.class)
    public void exploreConsumerHomepage() throws Exception {
        logManger.INFO("this is Info step log");
        logManger.ERROR("this is Error step log ");
        takeSnapShot(driver,"src/main/resources/xmlTests/Test.png");
        logManger.Capture();
        //logManger.Capture("src/main/resources/xmlTests/Test.png");
        logManger.ERROR("this is Error step log with screenshot and exception","");
        logManger.DEBUG("this is a Debug Step");
        ConsumerHomePage consumerHomePage = new ConsumerHomePage(driver);
        ConsumerHomePage.ExploreConsumerHomePage();


    }

    @Test(description = "The User Explore Business Home Page",suiteName = "Explore_HomePage", priority = 2,
            retryAnalyzer = com.qpros.helpers.RetryAnalyzer.class)
    public void exploreBusinessHomePage() throws Exception {
        BussinessHomePage bussinessHomePage = new BussinessHomePage(driver);
        bussinessHomePage.exploreBussinessHomePage();
    }

    @AfterClass(alwaysRun = true)
    public void tearDown() throws Exception {
        driver.quit();
    }
    public static void takeSnapShot(WebDriver webdriver,String fileWithPath) throws Exception{

        //Convert web driver object to TakeScreenshot

        TakesScreenshot scrShot = ((TakesScreenshot) webdriver);

        //Call getScreenshotAs method to create image file

        File SrcFile=scrShot.getScreenshotAs(OutputType.FILE);

        //Move image file to new destination

        File DestFile=new File(fileWithPath);

        //Copy file at destination

        FileUtils.copyFile(SrcFile, DestFile);

    }

}

